import React from 'react'
import './Footer.css'

import {useHistory} from 'react-router-dom'
import {Link} from 'react-router-dom'

export default () => {
    const history = useHistory()
    return(
        <>
            <span>TASK</span>
            <p>Daniel Rabelo Chaves</p>
            <p>Sistemas de Informação</p>
            <p>Universidade Newton Paiva</p>
            <button id="button" type="submit" onClick={() => history.push('https://github.com/DanielRabeloChaves?tab=repositories')}>GitHub</button>
        </>
    )
}
